    private static Rgba32 TransparentColor = new Rgba32(255, 0, 255);

    static async Task Main(string[] args)
    {
        var blocks = JsonConvert.DeserializeObject<List<Block>>(ScanData);
        TransformOrigin(blocks);
        blocks = GetVerticalSlice(blocks, 0, 0, int.MaxValue, int.MaxValue);
        TransformOrigin(blocks);
        await GenerateBlueprints(blocks, new Dictionary<string, Rgba32>
        {
            { "minecraft:white_wool", new Rgba32(255, 255, 255) },
            { "minecraft:black_wool", new Rgba32(0, 0, 0) },
            { "minecraft:yellow_wool", new Rgba32(255, 242, 0) },
            { "minecraft:orange_wool", new Rgba32(255, 127, 39) },
        });
    }

    private static (int minX, int minY, int minZ) GetMinCoordinates(List<Block> blocks)
    {
        return (blocks.Min(e => e.X), blocks.Min(e => e.Y), blocks.Min(e => e.Z));
    }

    private static void TransformOrigin(List<Block> blocks)
    {
        var minCoordinates = GetMinCoordinates(blocks);
        foreach (var block in blocks)
        {
            block.X -= minCoordinates.minX;
            block.Y -= minCoordinates.minY;
            block.Z -= minCoordinates.minZ;
        }
    }

    /*
     * Imagine top down view of the structure, origin is bottom-left
     * x is forward, y is up, z is right (because minecraft)
     */
    private static List<Block> GetVerticalSlice(List<Block> blocks, int startZ, int startX, int zDirectionBlocks, int xDirectionBlocks)
    {
        return blocks
            .Where(e => e.X >= startX && e.Z >= startZ && e.X < (startX + xDirectionBlocks) && e.Z < (startZ + zDirectionBlocks))
            .ToList();
    }

    /*
     * Based on turtle facing
     * x is forward, y is up, z is right (because minecraft)
     */
    private static async Task GenerateBlueprints(List<Block> blocks, Dictionary<string, Rgba32> colorMappings)
    {
        var index = 0;
        foreach (var layer in blocks.GroupBy(e => e.Y).OrderBy(e => e.Key))
        {
            while (index != layer.First().Y)
            {
                var emptyLayerImage = new Image<Rgba32>(1, 1);
                emptyLayerImage[0, 0] = TransparentColor;
                await emptyLayerImage.SaveAsPngAsync($"{index}.png");
                index++;
                continue;
            }

            var imageWidth = layer.Max(e => e.Z) + 1;
            var imageHeight = layer.Max(e => e.X) + 1;

            var image = new Image<Rgba32>(imageWidth, imageHeight);
            for (var imageY = 0; imageY < imageHeight; imageY++)
            {
                for (var imageX = 0; imageX < imageWidth; imageX++)
                {
                    image[imageX, imageY] = MapToRgba(layer, imageX, imageY, colorMappings);
                }
            }
            await image.SaveAsPngAsync($"{index}.png");

            index++;
        }
    }

    private static Rgba32 MapToRgba(IGrouping<int, Block> layer, int imageX, int imageY, Dictionary<string, Rgba32> colorMappings)
    {
        var block = layer.FirstOrDefault(e => e.Z == imageX && (layer.Max(e => e.X) - e.X) == imageY);
        if (block == null)
        {
            return TransparentColor;
        }

        return colorMappings.ContainsKey(block.Name)
            ? colorMappings[block.Name]
            : TransparentColor;
    }
